import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';
import Link from 'next/link'


const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,

    },
    button: {
        margin: theme.spacing(1),
        fontcolor: '#FBEFF2'
    },

    title: {
        flexGrow: 1,
    },


}));


function ButtonAppBar() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <AppBar position="static" style={{backgroundColor: '#0174DF'}}>
                <Toolbar>
                    <img src={"http://icons.iconarchive.com/icons/graphicloads/colorful-long-shadow/72/Car-icon.png"}
                         alt="Logo"/>
                    <h1 style={{margin: '0 5px'}}>Car Record</h1>

                        <Link href="/ManageAdmin"><Button  variant="outlined" color="#FFFFFF" className={classes.button}> Manage Admin</Button></Link>

                </Toolbar>

            </AppBar>
        </div>
    );
}

export default ButtonAppBar;
